import React from 'react';
import SearchBar from './SearchBar';
import WeatherCard from './WeatherCard';
import './App.css';

class App extends React.Component {

	state = { type: {} };

	onSearchSubmit(term) {
		const weatherData = fetch(`https://api.openweathermap.org/data/2.5/forecast?q=${term}&appid=8c5fb53f5e47ec25460b34d5e83664e9`).then(response => {
    	return response.json();
				}).then(data => {
    		console.log(data);
		})
		// this.setState({ type: weatherData });
		// console.log(this.state.type)
		console.log(weatherData);
	}



	render() {
		return (
			<div className='ui container'>
				<div className='search'>
					<SearchBar onSubmit={this.onSearchSubmit} />
				</div>
				<div className='forecast-box'>
					<WeatherCard />
					<WeatherCard />
					<WeatherCard />
					<WeatherCard />
					<WeatherCard />
				</div>
			</div>
		)
	}
}

export default App;

